import{_ as i,o as e,c as t,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 50-73.139 Withdrawal of a foreign registered limited liability partnership.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/50-73.139.md","filePath":"vacode/50-73.139.md"}'),r={name:"vacode/50-73.139.md"},s=a('<h1 id="§-50-73-139-withdrawal-of-a-foreign-registered-limited-liability-partnership" tabindex="-1">§ 50-73.139 Withdrawal of a foreign registered limited liability partnership. <a class="header-anchor" href="#§-50-73-139-withdrawal-of-a-foreign-registered-limited-liability-partnership" aria-label="Permalink to &quot;§ 50-73.139 Withdrawal of a foreign registered limited liability partnership.&quot;">​</a></h1><p>A foreign registered limited liability partnership authorized to transact business in this Commonwealth may withdraw from this Commonwealth by filing with the Commission a statement of cancellation of registration as a foreign registered limited liability partnership that shall set forth:</p><ol><li><p>The name of the foreign registered limited liability partnership and the state or other jurisdiction under whose jurisdiction it was registered as a limited liability partnership and the laws of which govern the agreement pursuant to which it was formed;</p></li><li><p>That the foreign registered limited liability partnership is not transacting business in this Commonwealth and that it surrenders its registration to transact business in this Commonwealth;</p></li><li><p>That the foreign registered limited liability partnership revokes the authority of its registered agent in this Commonwealth to accept service of process and appoints the clerk of the Commission as its agent for service of process in any action, suit, or proceeding based upon any cause of action arising during the time the foreign registered limited liability partnership was authorized to transact business in this Commonwealth; and</p></li><li><p>A mailing address to which the clerk of the Commission may mail a copy of any process served on him under subdivision 3.</p></li></ol><p>1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0292" target="_blank" rel="noreferrer">292</a>.</p>',4),o=[s];function n(l,h,d,p,c,m){return e(),t("div",null,o)}const _=i(r,[["render",n]]);export{g as __pageData,_ as default};
